import * as React from 'react';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

function HeroHome() {
  return (
    <>
      <Container maxWidth="1600">
        <Box sx={{ 
          padding: '1em',
          height: 'auto', 
          textAlign: 'center',
          marginTop: '4em',
          }}>
          <Typography sx={{ 
            fontFamily: 'Shadows Into Light, cursive', 
            fontSize: '5em', 
            fontWeight: '600',
            color: 'primary.dark'}}>
              GYMBRO</Typography>
          <Typography sx={{ 
            fontFamily: 'Shadows Into Light, cursive', 
            fontSize: '3em', 
            fontWeight: '400',
            marginTop: '1em',
            color: 'primary.dark'}}>
              The best way to build your training plan</Typography>
          <Button variant="contained" href="./pages/CreateRoutine" sx={{ 
            backgroundColor: 'primary.main',
            marginTop: '1em',
            fontFamily: 'Shadows Into Light, cursive', 
            fontSize: '3em', 
            fontWeight: '500',
            width: '40%',
            borderRadius: '20px',
            }}>USE NOW!</Button>
          </Box>
      </Container>
    </>
  );
}

export default HeroHome
